            double d = lexer.doubleValue();
            lexer.nextToken(JSONToken.COMMA);
            array.add(d);
        } else if (lexer.token() == JSONToken.LITERAL_BOOLEAN) {
            boolean b = lexer.booleanValue();
            lexer.nextToken(JSONToken.COMMA);
            array.add(b);
        } else if (lexer.token() == JSONToken.LITERAL_NULL) {
            lexer.nextToken(JSONToken.COMMA);
            array.add(null);
        } else if (lexer.token() == JSONToken.RBRACE) {
            lexer.nextToken(JSONToken.COMMA);
            return (T) array;
        } else {
            Object val = parser.parse();
            array.add(val);
        }
    }
}
